'''
5、对向量进行聚类
'''


def cluster():
    cv_weight, list = countvec()

    # 进行主成分分析
    pca = PCA(n_components=0.9)

    data = pca.fit_transform(cv_weight)
    # data = data[:500]
    # data.shape
    print("PCA Data", data)

    kmeans = KMeans(n_clusters=3, max_iter=10)

    kmeans.fit(data)

    # predict = kmeans.predict(cv_weight)
    # print(predict)

    # 打印出各个族的中心点
    print("kmeans 中心点： ", kmeans.cluster_centers_)

    r2 = pd.Series(kmeans.labels_).value_counts()
    print("各个类别个数：", r2)

    labels = pd.Series(kmeans.labels_)
    list1 = pd.DataFrame(list)
    result = pd.concat([list1, labels], axis=1)

    # book = load_workbook('label.xlsx')
    writer = pd.ExcelWriter('omcplabel.xlsx', engine='openpyxl')
    # writer.book = book
    result.to_excel(writer, sheet_name='Data1', startcol=0, index=False)
    writer.save()

    print("结果与标签联立：", result)

    # for index, label in enumerate(kmeans.labels_, 1):
    #
    #     print("index: {}, label: {}".format(index, label))

    # 样本距其最近的聚类中心的平方距离之和，用来评判分类的准确度，值越小越好

    # k-means的超参数n_clusters可以通过该值来评估

    print("inertia: {}".format(kmeans.inertia_))
    return kmeans


'''
6、可视化
'''


def show():
    cv_weight, data = countvec()
    tsne = TSNE(n_components=2)
    decomposition_data = tsne.fit_transform(cv_weight)
    kmeans = cluster()

    x = []
    y = []
    for i in decomposition_data:
        x.append(i[0])
        y.append(i[1])
    fig = plt.figure(figsize=(10, 10))
    ax = plt.axes()
    plt.scatter(x, y, c=kmeans.labels_, marker="x")
    plt.xticks(())
    plt.yticks(())
    plt.show()
    plt.savefig('./sample.png', aspect=1)
    mysql_conn.close()


if __name__ == "__main__":
    show()
